const timeZone = [
    {
      city: 'New York',
      zone: 'America/New_York',
    },
    {
      city: 'China',
      zone: 'Asia/Shanghai',
    },
    {
      city: 'Paris',
      zone: 'Europe/Paris',
    },
    {
      city: 'Pakistan',
      zone: 'Asia/Karachi',
    },
  ];
  
  export default timeZone;
